import React from 'react';
import './App.css';

import {Home} from './components_test/Home'
import {Department} from './components_test/Department'
import {Employee} from './components_test/Employee'
import {Navigation} from './components_test/Navigation'



import {BrowserRouter, Route, Switch} from 'react-router-dom'

function addTest() {
  return (
    <BrowserRouter>
    <div className="container">

      <h3 className="m-3 d-flex justify-content-center">
      React JS with Web api Demo</h3>
      <h5 className="m-3 d-flex justify-content-center">
      Employee Management Portal</h5>

      <Navigation/>

      <Switch>
      <Route path='/' component={Home} exact />
      <Route path='/department' component={Department}/>
      <Route path='/employee' component={Employee}/>
      </Switch>

    </div>
    </BrowserRouter>
  );
}

export default addTest;
